function binary_search($list, $item)
{
    $low = 0;
    $high = count($list)-1;
    while ($low<=$high) {
        $mid = floor(($low+$high)/2);
        $guess = $list[$mid];
        if ($guess == $item) {
            while($list[$mid-1]==$item){
                $mid--;
            }
            return $mid;
        }elseif ($guess > $item) {
            $high = $mid - 1;
        } else {
            $low = $mid + 1;
        }
    }
    return -1;
}
// $list = [1,1,2,3,7,7,7,9,9,10];
// $item = 2;
$list = [1,2,2,3,4];
$item = 2;
/*
    注意这是循环。
    [1,1,2,3,7,7,7,9,9,10]
    $low = 0;
    $high = 10-1 = 9;
    $mid = (0+9)/2 = 4;
    $list[4] = 7 > 2;
    $high = 4-1=3;
    缩小范围[1,1,2,3]
    $low = 0;
    $high = 4-1 = 3;
    $mid = (0+3)/2 = 1;
    $list[1] = 1<2;
    $low = 1 + 1 = 2;
    [2,3]
    $low = 2;
    $high = 3;
    $mid = (2+3)/2 = 2;
    $list[$mid] = 2 = 2;

*/
$re = binary_search($list, $item);
echo $re;
exit;
function search($list, $item)
{
    static $n=0;
    if (empty($list)) {
        return -1;
    }
    $car = array_shift($list);
    if ($item == $car) {
        return $n;
    }
    $n++;
    return search($list, $item);
}
